import React from "react";

function About() {
  return (
    <section id="about" className="py-20 container mx-auto px-6">
      <h2 className="text-3xl font-bold text-center mb-10">About Me</h2>
      <p className="text-lg text-center max-w-2xl mx-auto">
        I'm Ayush, a software developer who loves building interactive web apps and experimenting with OS concepts.  
        Skilled in <span className="font-semibold">React, Node.js, Tailwind CSS</span>, and passionate about learning new technologies.
      </p>
    </section>
  );
}

export default About;
